import React, {Component} from 'react';

type inputComponentProps = {
  fieldName: string;
};

export default class inputComponent extends Component<inputComponentProps> {
  id = () => {
    return this.props.fieldName.concat('input');
  };

  placeholder = value => {
    value = 'Enter ' + this.props.fieldName;
  };

  render() {
    return (
      <div>
        <p>{this.props.fieldName}</p>
        <input
          name={this.props.fieldName}
          id={String(this.id)}
          placeholder={String(this.placeholder)}
        ></input>
      </div>
    );
  }
}
